export const LAST_KNOWN_MEASUREMENT = `
    query($metricName: String!){
        getLastKnownMeasurement(metricName: $metricName){
            metric
            at
            value
            unit
        }
    }
`

export const GET_METRICS_QUERY = `
    query{
        getMetrics
    }
`
